import React, { useEffect, useState } from "react";

import api from "../../../api";


import Pikachu from '../../../imgs/Pikachu.jpg';

import './Styles.css';





const OurSoluctions = () => {


    const[Pokemon, setPokemon] = useState('bulbasaur');

    const[dataPokemon, setDataPokemon] = useState([]);
    const[PokemonName, setPokemonName] = useState([]);
    const[PokemonMoves, setPokemonMoves] = useState([]);
    const[PokemonType, setPokemonType] = useState([]);
    const[PokemonDex, setPokemonDex] = useState([]);
    const[PokemonIMG, setPokemonIMG] = useState([]);


    useEffect(() => {

        
        api.get(`/pokemon/${Pokemon}`)
            .then(response => {

            setDataPokemon(response.data)
            setPokemonName(response.data.name)
            setPokemonMoves(response.data.moves)
            setPokemonType(response.data.types[0].type.name)
            setPokemonDex(response.data.id)
            setPokemonIMG(response.data.sprites.other.home.front_default)

            console.log(dataPokemon)
            console.log(PokemonName)
            console.log(PokemonMoves)
            console.log(PokemonDex)
            console.log(PokemonType)
            console.log(PokemonIMG)

            })
            .catch( 
                error => {
                console.log(error + ' Pokemon inexistente')
                }
            )
            // eslint-disable-next-line react-hooks/exhaustive-deps
    },[])


    












    
    return (
        <div id="Our-soluctions">
            <h1>Nossas Soluções</h1>

            
            <ul className="items-grid">
            <li className="p1">
                <img src={PokemonIMG} alt="imagemP1" />          
                <h2>#{PokemonDex}º {PokemonName}</h2>
                <p>{PokemonType}</p>
                <p>{PokemonMoves}</p>
                <p>.feature 2</p>
                <p>.feature 3</p>
                <button  className="Btxt">Ver Solução</button>
            </li>

            <li className="p1">
                <img src={Pikachu} alt="imagemP1" />          
                <h2>Nome do produto #2</h2>
                <p>Descriçao do produto</p>
                <p>.feature 1</p>
                <p>.feature 2</p>
                <p>.feature 3</p>
                <button  className="Btxt">Ver Solução</button>
            </li>

            <li className="p1">
                <img src={Pikachu} alt="imagemP1" />          
                <h2>Nome do produto #3</h2>
                <p>Descriçao do produto</p>
                <p>.feature 1</p>
                <p>.feature 2</p>
                <p>.feature 3</p>
                <button  className="Btxt">Ver Solução</button>
            </li>

            <li className="p1">
                <img src={Pikachu} alt="imagemP1" />          
                <h2>Nome do produto #4</h2>
                <p>Descriçao do produto</p>
                <p>.feature 1</p>
                <p>.feature 2</p>
                <p>.feature 3</p>
                <button  className="Btxt">Ver Solução</button>
            </li>
            </ul>
        </div>
    )
}

export default OurSoluctions;
